import {Axios} from "@/services/axios.js"

export default{
     RegisterUser(data){
        try {
             let r=Axios.post('users',data)
            return r.data
        } catch (error) {
            return error
        }
    },

     LoginUser(data){
        try {
             Axios.post('auth/login',data)
            .then(response => response.json())
            .then(reponse => {
                return reponse.data
            })
            .catch(e => {
                return e.messages
            })
        } catch (error) {
            return error
        }
    }
}
